import '../Nav/Nav.css';
import {Link} from 'react-router-dom';

const Nav = () => {
    return (
 <nav>
 {/* <div> */}
    {/* <div className="Nav"> */}
            {/* <div className="inner"> */}
                <ul>
                    <li><Link to='/'>Home</Link></li>
                    <li><Link to='/Login'>Home &gt; Login</Link></li>
               
                </ul>
            {/* </div> */}
        {/*  </div> */}
{/*  </div> */}

</nav>
    );
}

export default Nav;
